import React from 'react';
import Pagination from '@material-ui/lab/Pagination';
import { setPageAction } from '../../redux/searcherDuck';
import { SearcherState } from '../../redux/reduxTypes';
import { useSelector, useDispatch } from 'react-redux';

const Paginator = () => {
    
    const totalPages = useSelector<SearcherState,SearcherState["totalPages"]>(
        (state) => state.totalPages
    )

    const page = useSelector<SearcherState,SearcherState["page"]>(
        (state) => state.page
    )
    
    const dispatch = useDispatch();

    const handleChangePage = (event: any, value: number) => {
        dispatch(setPageAction(value));
    }
    return (
        <div className='paginator'>
            <Pagination count={totalPages} page={page} shape="rounded" size="large" onChange={handleChangePage}/>
        </div>
    );
};

export default Paginator;
